
import { LitElement, html } from 'https://unpkg.com/@polymer/lit-element@^0.5.2/lit-element.js?module';


class AarloGlance extends LitElement {

	static get properties() {
		return {
			hass: Object,
			config: Object,
		}
	}

	static get outerStyleTemplate() {
		return html`
		<style>
			ha-card {
				position: relative;
				min-height: 48px;
				overflow: hidden;
			}
			hui-image.clickable {
				cursor: pointer;
			}
			.box {
				white-space: var(--paper-font-common-nowrap_-_white-space); overflow: var(--paper-font-common-nowrap_-_overflow); text-overflow: var(--paper-font-common-nowrap_-_text-overflow);
					position: absolute;
					left: 0;
					right: 0;
					bottom: 0;
					background-color: rgba(0, 0, 0, 0.3);
					padding: 4px 8px;
					font-size: 16px;
					line-height: 40px;
					color: white;
					display: flex;
					justify-content: space-between;
			}
			.middle {
				left: 10%;
				right: 10%;
				bottom: 35%;
			}
			.box .title {
				font-weight: 500;
				margin-left: 4px;
			}
			.box .status {
				font-weight: 500;
				margin-right: 4px;
				text-transform: capitalize;
			}
			ha-icon {
				cursor: pointer;
				padding: 2px;
				color: #a9a9a9;
			}
			ha-icon.state-update {
				color: #cccccc;
			}
			ha-icon.state-on {
				color: white;
			}
		</style>
		`;
	}

	static get innerStyleTemplate() {
		return html`
			<style>
				img {
					display: block;
					height: auto;
					transition: filter 0.2s linear;
					width: 100%;
				}
				.error {
					text-align: center;
				}
				.hidden {
					display: none;
				}
				.ratio {
					position: relative;
					width: 100%;
					height: 0;
				}
				.ratio img,
				.ratio div {
					position: absolute;
					top: 0;
					left: 0;
					width: 100%;
					height: 100%;
				}
				#brokenImage {
					background: grey url("/static/images/image-broken.svg") center/36px
					no-repeat;
				}
			</style>
		`;
	}

	// set hass( hass ) {
		// this._hass = hass
	// }

	_render( { hass,config } ) {
		var image_src = "data:image/jpeg;base64, ";

		const baseId     = config.camera;
		const cameraId   = 'camera.aarlo_' + baseId;
		const camera     = hass.states[cameraId];
		const captureId  = 'sensor.aarlo_captured_today_' + baseId;
		const capture    = hass.states[captureId];
		const motionId   = 'binary_sensor.aarlo_motion_' + baseId;
		const motionOn   = hass.states[motionId].state == 'on' ? 'state-on' : '';
		const soundId   = 'binary_sensor.aarlo_sound_' + baseId;
		const soundOn   = hass.states[soundId].state == 'on' ? 'state-on' : '';
		const batteryId   = 'sensor.aarlo_battery_level_' + baseId;
		const battery     = hass.states[batteryId];
		const signalId   = 'sensor.aarlo_signal_strength_' + baseId;
		const signal     = hass.states[signalId];
		const signalIcon = 'mdi:wifi-strength-' + signal.state;
		const capturedId = 'sensor.aarlo_captured_today_' + baseId;
		const captured   = hass.states[captureId].state;
		const lastId     = 'sensor.aarlo_last_' + baseId;
		const last       = hass.states[lastId].state;

		const name = config.name ? config.name : camera.attributes.friendly_name;


		// what are we showing?
		var show = config.show || [];
		var batteryHidden  = show.includes('battery') ? '' : 'hidden';
		var signalHidden   = show.includes('signal_strength') ? '' : 'hidden';
		var motionHidden   = show.includes('motion') ? '' : 'hidden';
		var soundHidden    = show.includes('sound') ? '' : 'hidden';
		var capturedHidden = show.includes('captured') ? '' : 'hidden';

		var motionText = 'Motion: ' + (motionOn != '' ? 'detected' : 'clear');
		var soundText = 'Sound: ' + (soundOn != '' ? 'detected' : 'clear');

		var batteryText = 'Battery Strength: ' + battery.state +'%';
		var batteryIcon = battery.state < 10 ? 'battery-outline' :
							( battery.state > 90 ? 'battery' : 'battery-' + Math.round(battery.state/10) +'0' )
		var signal_text = 'Signal Strength: ' + signal.state;

		var last_text = "Captured: ";
		if ( captured != 0 ) {
			last_text += 'today=' + captured;
		}
		if ( last ) {
			last_text += last_text != 'Captured: ' ? ', ' : ': '
			last_text += 'last=' + last;
		}

		var img = html`
			${AarloGlance.innerStyleTemplate}
			<div id="wrapper">
				<img id="image" src="${image_src}" on-error="_onImageError" on-load="_onImageLoad" />
				<div id="brokenImage"></div>
			</div>
		`;

		var state = html`
			<div class="box">
				<div class="title">
				${name} 
				</div>
				<div>
					<ha-icon class$="${motionOn} ${motionHidden}" icon="mdi:run-fast" title="${motionText}"></ha-icon>
					<ha-icon class$="${soundOn} ${soundHidden}" icon="mdi:ear-hearing" title="${soundText}"></ha-icon>
					<ha-icon class$="state-update ${capturedHidden}" icon="mdi:library-shelves" title="${last_text}"></ha-icon>
					<ha-icon class$="state-update ${batteryHidden}" icon="mdi:${batteryIcon}" title="${batteryText}"></ha-icon>
					<ha-icon class$="state-update ${signalHidden}" icon="${signalIcon}" title="${signal_text}"></ha-icon>
				</div>
				<div class="status">
					${camera.state}
				</div>
			</div>
		`;

		return html`
			${AarloGlance.outerStyleTemplate}
			<ha-card>
			${img}
			${state}
			</ha-card>
		`;
	}

    setConfig(config) {

        if( !config.camera ) {
            throw new Error( 'missing a camera' )
        }
        if( !config.show ) {
            throw new Error( 'missing a show' )
        }

        this.config = config
    }

    getCardSize() {
        return 3;
    }
}

customElements.define('aarlo-glance', AarloGlance);

